import React from "react";
import classes from './Header.module.css'
import HeaderCartButton from "./HeaderCartButton";


const Header = (props) => {
    return (
        <>
            <header className={classes.header}>
                <h1>ReactMeals</h1>
                <HeaderCartButton/>
            </header>
            <div className={classes['main-image']}>
                <img
                    src='https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/vegan-dishes-1620146357.jpg?crop=0.564xw:0.846xh;0.225xw,0.0685xh&resize=640:*'
                    alt="table of food"
                />
            </div>
        </>
    )
}
export default Header;
